import React, { useEffect, useState } from "react";
import { useParams } from "react-router-dom";
import PanelTemplate from "./PanelTemplate";

function Details() {
    const { id } = useParams();
    const [product, setProduct] = useState(null);

    // ✅ Görsel yollarının başına "/" koyduğundan emin ol (public klasöründe olduklarını varsayıyorum)
    const productImages = {
        1: "/images/sal.jpg",
        2: "/images/esarp.jpg",
        3: "/images/bone.jpg"
    };

    useEffect(() => {
        fetch(`http://localhost:5003/product/${id}`)
            .then((res) => {
                if (!res.ok) throw new Error("Sunucu hatası: " + res.status);
                return res.json();
            })
            .then((data) => {
                setProduct(data);
            })
            .catch((err) => console.error("Veri çekme hatası:", err));
    }, [id]);

    if (!product) return <div style={{ padding: "20px" }}>Ürün bilgisi yükleniyor veya bulunamadı...</div>;

    return (
        <PanelTemplate
            role="manager"
            rightContent={
                <div style={{ padding: "20px" }}>
                    <h2 style={{ borderBottom: "2px solid #eee", paddingBottom: "10px" }}>
                        Ürün Detay Paneli (Master-Detail)
                    </h2>

                    <div style={{ display: "flex", gap: "40px", marginTop: "20px", flexWrap: "wrap" }}>

                        {/* ✅ SOL TARAF: Ürün Görseli Düzenlendi */}
                        <div style={{ flex: "1", minWidth: "300px" }}>
                            <img
                                // Görsel yoksa veya default ise kategoriye göre resim seçer
                                src={product.image_url && product.image_url !== "/images/default.png"
                                    ? product.image_url
                                    : (productImages[product.category_id] || "/images/default.png")}

                                // ✅ alt kısmındaki hatalı {p.category_name} düzeltildi
                                alt={`${product.material} ${product.category_name}`}

                                style={{
                                    width: "100%",
                                    borderRadius: "15px",
                                    boxShadow: "0 4px 15px rgba(0,0,0,0.1)",
                                    maxHeight: "500px",
                                    objectFit: "cover"
                                }}
                                onError={(e) => {
                                    console.log("Resim yüklenemedi, default atanıyor.");
                                    e.target.src = "/images/default.png";
                                }}
                            />
                        </div>

                        {/* SAĞ TARAF: Veritabanı Detayları */}
                        <div style={{ flex: "1", minWidth: "300px" }}>
                            <div style={{ backgroundColor: "#f9f9f9", padding: "20px", borderRadius: "12px" }}>
                                <p><strong>Ürün ID:</strong> #{product.product_id}</p>
                                <p><strong>Kategori:</strong> {product.category_name}</p>
                                <p><strong>Materyal:</strong> {product.material}</p>
                                <p><strong>Renk:</strong> {product.color}</p>
                                <p><strong>Fiyat:</strong> <span style={{ color: "#2e7d32", fontSize: "1.2em", fontWeight: "bold" }}>{product.price} TL</span></p>
                                <p><strong>Stok Durumu:</strong> {product.quantity} Adet</p>

                                <hr />
                                <p style={{ fontSize: "0.9em", color: "#666" }}>
                                    * Bu veriler <strong>view_product_details</strong> üzerinden getirilmiştir.
                                </p>
                            </div>

                            <button style={{
                                marginTop: "20px",
                                width: "100%",
                                padding: "15px",
                                backgroundColor: "#ff9800",
                                color: "white",
                                border: "none",
                                borderRadius: "8px",
                                cursor: "pointer",
                                fontSize: "1.1em",
                                fontWeight: "bold"
                            }}>
                                Sepete Ekle
                            </button>
                        </div>
                    </div>
                </div>
            }
        />
    );
}

export default Details;
